import 'package:mobile_bro_food_admin_panel/model/Addres.dart';import 'package:mobile_bro_food_admin_panel/model/food_model.dart';List<OrderModel> listOrder(Map order){    List result = [];    order.forEach((key, value) {      result.add(value);    });    print(result);    List<OrderModel> orders =  result.map((e) => OrderModel.fromJson(        e))        .toList();    return orders;}class OrderModel { late  String numberPhone; late String token; late bool isDelivered; late String comment; late  String typePay; late String deliveryTime; late List<Foods> foods; late List<Addres> addres;  OrderModel({      required this.numberPhone,      required this.token,    required   this.foods,    required  this.addres,    required    this.comment,    required   this.typePay,    required  this.deliveryTime,required this.isDelivered});  OrderModel.fromJson(dynamic json) {    numberPhone = json['numberPhone'];    token = json['token'];    comment = json['comment'];    isDelivered = json['isDelivered'];    typePay = json['typePay'];    deliveryTime = json['deliveryTime'];    json['foods'].map((item)=>foods.add(item));    json['addres'].map((item)=>addres.add(item));    addres = json['addres'];  }  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['numberPhone'] = numberPhone;    map['token'] = token;    map['foods'] = foods;    map['isDelivered'] = isDelivered;    map['addres'] = addres;    map['comment'] = comment;    map['typePay'] = typePay;    map['deliveryTime'] = deliveryTime;    return map;  }}